import React from 'react';
import classes from './Logo.module.css';
import img from '../../assests/Images/chineseResLogo.png';

const Logo = () => {
    return (
        <div className = {classes.Logo}>
            <img src = {img} alt="burger-logo" />
        </div>
    )
}
export default Logo;
